@app.route("/")
def welcome():
    return "<p>Welcome to Pineapple Bun Service. </p> <p>There are a couple API services running so far, including getting fare prices for Taipei Mass Rapid Transit. </p>"

@app.route("/getTicketPrice/<departure>/<destination>")
def getTicketPrice(departure, destination):
    code_dep = departure.upper()
    code_des = destination.upper()
    query_dep = code_dep
    query_des = code_des
    
    # Check if supplied codes are not in stored format, then change it
    if code_dep in missing_codes:
        query_dep = existing_codes[missing_codes.index(code_dep)]

    if code_des in missing_codes:
        query_des = existing_codes[missing_codes.index(code_des)]

    fare = fares[codes.index(query_dep)][codes.index(query_des)]

    name_dep, name_des = names[query_dep], names[query_des]

    return {"Departure_Station_Code": code_dep, "Departure_Station_Name": name_dep, "Destination_Station_Code": code_des, "Destination_Station_Name": name_des, "Fare": {"Adult_Full_Fare": fare[0], "Senior_Charity_Companion_New_Taipei_City_Children": fare[1], "Taipei_City_Children": fare[2]}, "Distance": fare[3]}
